import React from "react";
import { Table } from "@mui/material";
import axios from "axios";

const ParentComponent = (props) => {
    const [userData, setUserData] = useState({});
    const [loading, setLoading] = useState(false);
    const [columns, setColumns] = useState([]);
    const [dataa, setDataList] = useState([]);
    const [refresh, setRefresh] = useState(false);


    React.useEffect(() => {
        const getData = async () => {
            let dataa = (
                await axios.get('http://localhost:5000/session')
            ).data;
            //setValue(data[0]);
            setDataList(dataa);
        };
        getData().catch((err) => console.log(err));
    }, [refresh]);

    const getData = async () => {
        await axios.get("https://localhost:5000/getNonAdmins").then((resp) => {
            let data = resp.data.data.sort((a, b) =>
                a.first_name.localeCompare(b.first_name)
            );
            let cols = Object.keys(data[0]).map((key) => {
                return {
                    Header: key.toUpperCase(),
                    accessor: key
                };
            });
            setUserData(data);
            setColumns(cols);
            setLoading(false);
        }
        )
    }

    return (
        <Table columns={columns} userData={userData} />
    )
}
